import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div className="w-64 bg-gray-800 text-white p-6">
      <h2 className="text-lg font-semibold mb-6">Projects</h2>
      <ul>
        <li><Link to="/project1" className="block py-2 px-4 hover:bg-gray-700 rounded">Project 1</Link></li>
        <li><Link to="/project2" className="block py-2 px-4 hover:bg-gray-700 rounded">Project 2</Link></li>
        <li><Link to="/project3" className="block py-2 px-4 hover:bg-gray-700 rounded">Project 3</Link></li>
      </ul>
    </div>
  );
};

export default Sidebar;
